UPDATE QUESTION SET QUESTION_ID = QUESTION_ID + 10000;


DROP TABLE SEQ_QUESTION_ID;

DROP PROCEDURE IF EXISTS p;

DELIMITER //
CREATE PROCEDURE p ()
BEGIN
  DECLARE 
    max_id INT;

  SELECT MAX(QUESTION_ID) + 1 INTO max_id FROM QUESTION;
  SET @create_seq := 'CREATE TABLE SEQ_QUESTION_ID (id bigint(19) not null auto_increment, primary key (id)) ENGINE MyISAM';
  PREPARE create_seq_stmt FROM @create_seq;
  EXECUTE create_seq_stmt;
  DEALLOCATE PREPARE create_seq_stmt;
  SET @alter_seq := concat('ALTER TABLE SEQ_QUESTION_ID auto_increment = ', max_id);
  PREPARE alter_seq_stmt FROM @alter_seq;
  EXECUTE alter_seq_stmt; 
  DEALLOCATE PREPARE alter_seq_stmt;
END //
DELIMITER ;

CALL p ();

DROP PROCEDURE IF EXISTS p;